import React from 'react';
import InboxIcon from '@material-ui/icons/Inbox';

function IconText({text1, text2}) {
    return (
        <div>
            <div className="icon-text">
                <InboxIcon/>
                <span>{text1}</span>
                <span className="highlight">{text2}</span>
            </div>
        </div>
    );
}

export default IconText;
